        public ActionResult AutoCompleteAcceptorChecklist(int PlotID, int SubSectionID)
        {
            using (SiteManagementSystemContext db = new SiteManagementSystemContext())
            {
                byte[] signatureImage = Encoding.ASCII.GetBytes("");
                BQCSubSectionSignatures signature = new BQCSubSectionSignatures()
                {
                    BQCSubSectionID = SubSectionID,
                    PlotID = PlotID,
                    UserID = "058203ea-0d0d-42c9-aa28-1de29bd27b5b",
                    Name = "Daniel Wood",
                    Signature = signatureImage,
                    SignedDateTime = DateTime.Now,
                };
                db.BQCSubSectionSignatures.Add(signature);
                db.SaveChanges();

                List<BQCQuestions> allQuestions = db.BQCQuestions.Where(r => r.BQCSubSectionID == SubSectionID).ToList();
                foreach (BQCQuestions question in allQuestions)
                {
                    BQCResponses mostRecentResponse = db.BQCResponses.Where(r => r.BQCQuestionID == question.BQCQuestionID && r.PlotID == PlotID).OrderByDescending(r => r.ApproverResponseDateTime).FirstOrDefault();
                    if (mostRecentResponse != null)
                    {
                        if (mostRecentResponse.ApproverResponseEnumValue != (int)ApprovalResponseTypes.Approve && mostRecentResponse.ApproverResponseEnumValue != (int)ApprovalResponseTypes.SubjectToConditions)
                        {
                            saveResponse();
                        }
                    }
                    else
                    {
                        saveResponse();
                    }
                    void saveResponse()
                    {
                        BQCResponses bQCResponses = new BQCResponses()
                        {
                            BQCQuestionID = question.BQCQuestionID,
                            PlotID = PlotID,
                            AcceptorName = "Daniel Wood",
                            AcceptorUserID = "058203ea-0d0d-42c9-aa28-1de29bd27b5b",
                            AcceptorWorkCompleted = true,
                            AcceptorWorkCompletedComment = "Test comment provided by TradeContractor",
                            AcceptorWorkCompletedDateTime = DateTime.Now,
                        };
                        db.BQCResponses.Add(bQCResponses);
                        db.SaveChanges();
                    }
                }

                int sectionId = BQCDictionary.getSectionIDFromSubSectionID(SubSectionID);
                return Json(new { success = true }, JsonRequestBehavior.AllowGet);
            }
        }
