        #region Staff And Trade Contractor
        public ActionResult LoadChecklist(string plotId, int? sectionId)
        {
            int decryptedPlotID = int.Parse(Utils.Decrypt(plotId));
            int siteId = BQCDictionary.getSiteIDFromPlotID(decryptedPlotID);
            int sectionIdToLoad  = (sectionId != null) ? (int)sectionId : BQCDictionary.geSectionIDToLoadNextFromPlot(decryptedPlotID);
            ViewBag.SectionStatusEnum = BQCDictionary.getStatusOfSection(sectionIdToLoad, decryptedPlotID);

            if (User.IsInRole("Subcontractor"))
            {
                if(sectionId== null)
                {
                    return RedirectToAction("LoadTradeContractorSections", new { plotId = plotId });
                }
                ChecklistModel checklistModel = BQCDictionary.getTradeContractorChecklistModel(decryptedPlotID, sectionIdToLoad);
                checklistModel.PaymentAuthModel = new PaymentAuthorisationModel();
                return View("TradeContractor/TradeContractorChecklist", checklistModel);
            }
            //site management
            else
            {
                SectionModel sectionModel = BQCDictionary.getSubSectionsForStaffSection(siteId, decryptedPlotID, sectionIdToLoad);
                return View("SiteManagement/Section", sectionModel);
            }
        }
        public ActionResult getSubSectionPartialView(int SubSectionID, int PlotID)
        {
            using(SiteManagementSystemContext db = new SiteManagementSystemContext())
            {
                ChecklistModel checklistModel = BQCDictionary.getSubSectionPartialView(SubSectionID, PlotID);

                BQCSubSections subSection = db.BQCSubSections.FirstOrDefault(r => r.BQCSubSectionID == SubSectionID);
                int subSectionType = BQCDictionary.getSubSectionTypeEnum(subSection, null);
                
                if (subSectionType == (int)SubSectionType.PaymentAuthorisation)
                {
                    return PartialView("PaymentAuthorisation/_PaymentAuthorisation", checklistModel);
                }
                else if (subSectionType == (int)SubSectionType.StaffChecklist)
                {
                    return PartialView("SiteManagement/_StaffChecklist", checklistModel);
                }
                else
                {
                    return PartialView("SiteManagement/_TradeContractorChecklistApprovalForStaff", checklistModel);
                }
            }
        }
