        public ActionResult LoadTradeContractorSections(string plotId, int? sectionId)
        {
            int decryptedPlotID = int.Parse(Utils.Decrypt(plotId));
            int siteId = BQCDictionary.getSiteIDFromPlotID(decryptedPlotID);
            SiteInformationModel siteInfo = BQCDictionary.getSiteInformationModel(siteId);
            PlotInformationModel plotInfo = BQCDictionary.getPlotInformationModel(decryptedPlotID);
            ChooseTradeContractorSectionViewModel chooseSectionModel = new ChooseTradeContractorSectionViewModel()
            {
                SitePlotInfo = new SiteAndPlotInformationModel() { SiteInfo = siteInfo, PlotInfo = plotInfo },
                RoleNameEnum = ((AllRoles)identityDictionary.getRoleEnumValueOfCurrentUser()).AsString(EnumFormat.Description),
            };
            return View("TradeContractor/ChooseSection", chooseSectionModel);
        }
